import React from 'react';
import '../styles/components.css';

const Projects = () => {
  // Temporary logos (replace with actual logos later)
  const logos = Array(8).fill().map((_, i) => ({
    id: i + 1,
    alt: `Logo ${i + 1}`,
    // Using placeholder images from placeholder.com
    src: `https://via.placeholder.com/100x60/2D2D2D/666666?text=Logo+${i + 1}`,
  }));

  // Duplicate the logos array to create a seamless loop
  const duplicatedLogos = [...logos, ...logos];

  return (
    <section id="projects">
      <div className="glass-card">
        <h2 className="section-title">Projects</h2>
        <div className="marquee-container">
          <div className="marquee-track">
            {duplicatedLogos.map((logo, index) => (
              <div key={`${logo.id}-${index}`} className="marquee-item">
                <img 
                  src={logo.src} 
                  alt={logo.alt} 
                  className="logo"
                />
              </div>
            ))}
          </div>
        </div>
      </div>
    </section>
  );
};

export default Projects;
